import React from 'react'

export default function Content() {
  return (
    <div style = {{
      border: '2px solid red',
      height: '60vh',
      color: '#151617',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
    }}>
      <h1 style = {{
        color: '#151617'
      }}>Contact Me:</h1>
      <span style = {{
        color: '#151617'
      }}>Email: douglasjordan2@gmail.com</span>
      <span style = {{
        color: '#151617'
      }}>Phone: (563) 200-4772</span>
    </div>
  )
}
